    private void addMovie(String name, String genre, double rating, String svgLogo) {
        Map<String, Object> movie = Map.of(
                "movieId", movieList.size(),
                "movieName", name,
                "movieGenre", genre,
                "movieRating", rating,
                "svgLogo", svgLogo
        );
        this.movieList.add(movie);
    }

    public Map<String, Object> getRandomMovie() {
        Random random = new Random();
        int index = random.nextInt(movieList.size());
        return movieList.get(index);
    }

    @Override
    public List<Map<String, Object>> getAllMovies() {
        return this.movieList;
    }

    @Override
    public List<Map<String, Object>> getMovieById(Integer movieId) {
        List<Map<String, Object>> movie = new ArrayList<>();
        movie.add(this.movieList.get(movieId));
        return movie;
    }

    @Override
    public Map<String, Object> getFinalMovie() {
//        List<Map<String, Object>> movie = new ArrayList<>();
//        movie.add(this.getRandomMovie());
        return this.getRandomMovie();
    }

